import styles from './styles.module.scss'

export function SubTitle() {
  return (
    <h3 className={styles.subtitle + ' d-flex justify-content-center'}>
      Uma nova forma de investir e educar seu dinheiro na nova moda, nosso
      projeto está projetado na rede da Binance Smart Chain e está repleto de
      novidades, todos os investidores da PrimBank estarão acompanhados por uma
      rede social e um blog a evolução do ativo.
    </h3>
  )
}
